  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Okefenokee
  National Wildlife Refuge summarizes refuge activities during the 1990 calendar year.
  \ The report begins with a summary of the yearu2019s highlights and climatic conditions.
  The report includes a planning section which discusses public participation, compliance
  with environmental and cultural resource mandates, research and investigations.
  \ Refuge administration is outlined; information about personnel, youth programs,
  volunteer programs, funding, safety, technical assistance, and other items is given.
  \ Habitat management is also covered.  Subjects include general, wetlands, forests,
  fire management, and wilderness and special areas.  The wildlife section of the
  report discusses wildlife diversity, endangered and/or threatened species, waterfowl,
  marsh and water birds, shorebirds, gulls, terns, and allied species, raptors, other
  migratory birds, game mammals, other resident wildlife, fisheries resources, scientific
  collections, marking and banding.  The public uses of the refuge described in this
  report include general, outdoor classrooms - students, outdoor classrooms - teachers,
  interpretive foot trails, interpretive tour routes, interpretive exhibits/demonstrations,
  other interpretive programs, hunting, fishing, wildlife observation, other wildlife
  oriented recreation, law enforcement, cooperating associations, and concessions.
  \ The equipment and facilities section of the report provides information about
  new construction, rehabilitation, major maintenance, equipment utilization and replacement,
  communications systems, computer systems, and energy conservation.  Items of interest
  are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
